import React from 'react';

const Hero = () => {
    return (
        <section>
            <img
                src='https://3.bp.blogspot.com/-sM393c3a8WE/Xb0x0faU6nI/AAAAAAAAGeg/cCYU8sZwSFkqSuhAeOfPM5tNHKtFxBb0wCLcBGAsYHQ/s1600-rw/00-Photoshop-Turn-a-Photo-into-a-Hexagon-Collage-600x400-min.jpg'
                alt=""
                className='hero--photo'
            />
            <h1 className='hero--header'>Online Experiences</h1>
            <p className='hero--text'>Join unique interactive activities led by one-of-a-kind hosts-all without leaving home.</p>
        </section>
    );
};

export default Hero;
